<div id=""floating-panel"">
    <input onclick=""clearMarkers();"" type=button value=""Hide Markers"">
    <input onclick=""showMarkers();"" type=button value=""Show All Markers"">
    <input onclick=""deleteMarkers();"" type=button value=""Delete Markers"">
</div>
<div id=""map"" style=""width:400px;height:400px;""></div>

<script>

    //temp variables
    //----------------
    var form = document.getElementsByTagName(""form"")[0];
    var labels = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ';
    var labelIndex = 0;
    var map;
    var locations = [
        {
            cityName: ""cracow"",
            latitude: 50.0647,
            longitude: 19.9450
        }
    ];
    var markers = [];



    function initMap() {
        map = new google.maps.Map(document.getElementById('map'), {
            center: new google.maps.LatLng(locations[0].latitude, locations[0].longitude),
            zoom: 10,
            mapTypeId: 'terrain'
        });

        // This event listener will call addMarker() whe");
            WriteLiteral(@"n the map is clicked.
        map.addListener('click', function (event) {
            addMarker(event.latLng);
            addParametersToInputs();
        });
    }

    function addParametersToInputs() {
        form[0].value = markers[markers.length - 1].label;
        form[1].value = markers[markers.length - 1].getPosition().lat();
        form[2].value = markers[markers.length - 1].getPosition().lng();
        form[3].value = window.prompt(""podaj opis markera"");
    }

    //Addmarker--------------
    function addMarker(location) {
        var marker = new google.maps.Marker({
            position: location,
            label: labels[labelIndex++ % labels.length],
            map: map
        });
        markers.push(marker);
    };

    // Sets the map on all markers in the array.
    function setMapOnAll(map) {
        for (var i = 0; i < markers.length; i++) {
            markers[i].setMap(map);
        }
    }

    // Removes the markers from the map, but keeps them in");
            WriteLiteral(@" the array.
    function clearMarkers() {
        setMapOnAll(null);
    }

    // Shows any markers currently in the array.
    function showMarkers() {
        setMapOnAll(map);
    }

    // Deletes all markers in the array by removing references to them.
    function deleteMarkers() {
        clearMarkers();
        markers = [];
        labelIndex = 0;
        form.reset();
    }
    //prevent default on submit click id=""dupa""
    function prevDef(e) {
        e.preventDefault();
    }

    google.maps.event.addDomListener(window, 'load', initialize);
</script>
